import React from "react"
import { BrowserRouter as Router, Route } from "react-router-dom"
import "./styles/App.css"
import List from "./List"

export default function App() {
  return (
    <Router>
      <div>
        <Route path="/" component={List} />
      </div>
    </Router>
  )
}
